import React from 'react';

const Spinner = (props) => {
	const fun = () => {
		setTimeout(() => {
			return <h1>Loading</h1>;
		}, 7000);
	};
	return (
		<div>
			<div>{fun()}</div>
		</div>
	);
};

export default Spinner;
